int mm( int n, int i)
{
    int sum=1;

    if(dp[n][i]>0) return dp[n][i];


    for(int j=i; j<=sqrt(n);j++)
    {
             if(n%j==0)
             {
                       sum += mm(n/j,j);
             }
    }
    dp[n][i]=sum;
